import { configureStore } from "@reduxjs/toolkit";
import todoSlice from "./authSlice";
import todoSlice1 from "./authSlice2";

const store = configureStore({
  reducer: {
    mySlice: todoSlice,
    mySlice1: todoSlice1,
  },
});

export default store;
